// Navbar.js
import React from 'react';

const Navbar = () => {
  return (
    <nav className='navbar'>
      <div>
        <button><a href="/">Home</a></button>
        <button><a href="/login">Login</a></button>
        <button><a href="/signup">Signup</a></button>
        <button><a href="/cart">Cart</a></button>
      </div>
    </nav>
  );
}

export default Navbar;
